import React, {Component} from 'react';
import { Link } from 'react-router-dom';

class Search extends Component{
    constructor(props){
        super(props)
        this.state = {
            city: "",
            suburb: "",
            checkin:null,
            checkout:null
        }
    }
    handleSubmit= (event) =>{
        event.preventDefault()
        const data=this.state
        console.log(data)
    }    
    handleInputChange = (event) =>{
        event.preventDefault()
        this.setState({
            [event.target.name] : event.target.value
        })

    }

    render(){
        const {city} =this.state
        const {suburb} =this.state
        const {checkin} =this.state
        const {checkout} =this.state
    return (
        <div className="Search">
            <h2>Find your place</h2>
            <br/>
            <form onSubmit={this.handleSubmit}>
                <label className="ci"><b>City:</b>
                    <input type="text" name="city" value={city} placeholder="input city name"
                    onChange={this.handleInputChange}/>
                </label>
                <br/>
                <label className="ci"><b>Surburb:</b>
                    <input type="text" name="suburb" value={suburb} placeholder="input suburb name"
                    onChange={this.handleInputChange}/>  
                </label>
                <br/>
                <label className="ci"><b>Check in:</b>
                <input type="date" name="check in" value={checkin} placeholder="input check in date"/>
                </label>
                <br/>
                <label className="ci"><b>Check out:</b>
                    <input type="date" name="check out" value={checkout} placeholder="input check out date"/>
                </label>
                <br/>
                <button className="sea_button">
                    <h3>search</h3>
                </button>
            </form>


        </div>
    );
    }
}
export default Search;
